/** @format */

const DogList = ({ dogs }) => {
  console.log(dogs);
  return (
    <div>
      <h1>Dog List</h1>
      <ul>
        {dogs.map((m) => {
          return (
            <li style={{ border: "dashed" }}>
              <h2>{m.name}</h2>
              <p>Age: {m.age}</p>
              <img src={m.src} alt={m.name}></img>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default DogList;
